etCreatedTime() {		return createdTime;	}	public void setCreatedTime(long createdTime) {		this.createdTime = createdTime;	}	public String getLastModifiedBy() {		return lastModifiedBy;	}	public void setLastModifiedBy(String lastModifiedBy) {		this.lastModifiedBy = lastModifiedBy;	}	public Object getLastModifiedTime() {		return lastModifiedTime;	}	public void setLastModifiedTime(long lastModifiedTime) {		this.lastModifiedTime = lastModifiedTime;	}	public List<Practice> getPractices() {		return practices;	}	public void setPractices(List<Practice> practices) {		this.practices = practices;	}	public List<Tag> getTags() {		return tags;	}	public void setTags(List<Tag> tags) {		this.tags = tags;	}	//override toString Method 	public String toString() {		StringBuffer sb=new StringBuffer();		sb.append("{");		sb.append("'exmaId':'"+this.getExmaId()+"',");		sb.append("'subject':'"+this.getSubject().toString() +"',");		sb.append("'code':'"+this.getCode()+"',");		sb.append("'titile':'"+this.getTitle()+"',");		sb.append("'decription':'"+this.getDecription()+"',");		sb.append("'isPublic':'"+this.getIsPublic()+"',");		sb.append("'duration':'"+this.getDuration()+"',");		sb.append("'statusId':'"+this.getStatusId()+"',");		sb.append("'isDelete':'"+this.getIsDelete()+"',");		sb.append("'createdTime':'"+this.getCreatedTime()+"',");		sb.append("'lastModifiedBy':'"+this.getLastModifiedBy()+"',");		sb.append("'lastModifiedTime':'"+this.getLastModifiedTime()+"',");		sb.append("'practice.size':'"+this.getPractices().size() +"',");		sb.append("'tags.size':'"+this.getTags().size() +"',");		sb.append("}");		return sb.toString();	}	//return String[] filed; 	public String[] getField() {		return new String[]{"exmaId","subject","code","title","decription","isPublic","duration","statusId","isDelete","createdTime","lastModifiedBy","lastModifiedTime","practices","tags"};	}}